import React, { Component } from 'react'
import { Redirect } from 'react-router-dom';

import axios from 'axios'
export default  function AuthMiddleware(ComponentToProtect, props) {
    console.log('test')
    return <Redirect to="/admin/login" />;
    return <ComponentToProtect {...props} />
    try {
        var result =  axios.post(process.env.REACT_APP_ADMIN_URL + '/checktoken')
        return <ComponentToProtect {...props} />
    }
    catch (error) {
        return <Redirect to="/admin/login" />;
    }
}
